export default {
  name: 'StIcon',
  props: {
    type: {
      type: String,
      required: true,
      default: ''
    },
    size: {
      type: String,
      default: '1em'
    },
    color: {
      type: String,
      default: 'currentColor'
    }
  },
  computed: {
    linkHref() {
      return `#sticon-${this.type}`
    },
    isAntIcon() {
      return this.type.indexOf('anticon:') > -1
    },
    antType() {
      return this.type.split(':')[1]
    }
  }
}
